	add("daltonism", "{\"term\":\"daltonism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named for the English chemist w:John Dalton|John Dalton (1766–1844), who had the condition and did early research into it.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inability or defective ability to perceive or distinguish certain colors, especially red-green color blindness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Richard Davies, \u0027Descartes: Belief, Scepticism and Virtue\u0027, [https://books.google.com.au/books?id\u003ddpiCAgAAQBAJ\u0026amp;pg\u003dPA25\u0026amp;dq\u003d%22Daltonism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duOSQVaPfNYPy8QWjpqiYAw\u0026amp;ved\u003d0CPUBEOgBMC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Daltonism%22\u0026amp;f\u003dfalse page 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person with \u0027\u0027Daltonism\u0027\u0027 may be said to lack a discriminatory power that others have: his perceptions of red and green are, as such, not to be relied on\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Gordon Plant, James Acheson, Charles Clarke, Elizabeth Graham, Robin Howard, Simon Shorvon, \u002713: Neuro-Opthalmology\u0027, Charles Clarke, Robin Howard, Martin Rossor, Simon D. Shorvon (editors), \u0027Neurology: A Queen Square Textbook\u0027, [https://books.google.com.au/books?id\u003d0BpFs2KlnH4C\u0026amp;pg\u003dPT784\u0026amp;dq\u003d%22Daltonism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duOSQVaPfNYPy8QWjpqiYAw\u0026amp;ved\u003d0CIACEOgBMC\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Daltonism%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Ishihara plates were developed for the assessment of congenital colour anomalies (\u0027\u0027Daltonism\u0027\u0027) and so there is considerable detail in the testing that is not relevant to optic nerve disease where the losses do not follow the specific patterns seen in \u0027\u0027Daltonism\u0027\u0027 but show largely global losses\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Sevasti Trubeta, \u0027Physical Anthropology, Race and Eugenics in Greece (1880s–1970s)\u0027, [https://books.google.com.au/books?id\u003dwfqZAAAAQBAJ\u0026amp;pg\u003dPA109\u0026amp;dq\u003d%22Daltonism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003duOSQVaPfNYPy8QWjpqiYAw\u0026amp;ved\u003d0CHoQ6AEwE\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Daltonism%22\u0026amp;f\u003dfalse page 109\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The concern of Kosmetatos was not how affected individuals would manage to organize their lives taking the effects of \u0027\u0027Daltonism\u0027\u0027 as given; rather, using the specific case of \u0027\u0027Daltonism\u0027\u0027, he suggested the bureaucratization and surveillance of humans by recording their health condition over long periods\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Achromatopsia\", \"priority\":11}]}, \"synonyms\":{}}");

